gne!ü§§ North and South, Emilia Romagna and Campania, Bologna and NaplesüáÆüáπ The Lasagna alla Bolognese with spinach noodle, besciamella, and raguÃÄ bolognese, and parmigiana. The Lasagna Napoletana with durum noodle, ricotta, raguÃÄ Napoletana, sausage, egg, tiny little meatballs, provola (I had provolone), and pecorino. Everything homemade, including the noodles. I used the method where the noodles overstretch the sides of the pan and are later folded down over top to enclose the lasagna. With great daring, I decided I could make these lasagne in the same pan. And it workedüòÉ

